import re
from bs4 import BeautifulSoup

SITE_URL_REGEX = re.compile(r'https?://(www\.cnn\.com|www\.bloomberg\.com)')

def get_articles(html):
    soup = BeautifulSoup(html, 'html.parser')

    articles = []
    for link in soup.find_all('link'):
        if SITE_URL_REGEX.match(link.get('href')):
            articles.append({
                'title': link.get('title'),
                'url': link.get('href'),
                'description': link.get('description')
            })

    return articles

def summarize(site):
    try:
        html = requests.get(site).text
        articles = get_articles(html)
        return articles
    except:
        return []

for article in summarize('www.cnn.com'):
    print(article['title'])

